import React, { use, useState } from "react";

export default function TodoList() {

    return (
        <>
            <Form />
            <AllItems/>
        </>
    );

}

function Form() {
    let [items,setItems]=useState([]);
    let [itemName,setItem] = useState("");
    

    function handleAddItem(item){
        setItems((items)=>{
            return [...items,item];
        });
    }




    return (
        <>
            <section className="container-fluid mt-5">
                <div className="row">
                    <div className="col-5 m-auto">
                        <div className="card">
                            <div className="card-header bg-dark text-white text-center">
                                <h1>Todo List</h1>
                            </div>
                            <div className="card-body">
                                <form>
                                    <div className="mb-2">
                                        <input type="text" className="form-control" placeholder="Enter Item Name" />
                                    </div>
                                    <div className="mb-2">
                                        <input type="text" className="form-control" placeholder="Enter Quantity" />
                                    </div>
                                    <input type="submit" name="" id="" className="btn btn-dark"/>
                                </form>
                            </div>
                        </div>
                    </div>
                </div>
            </section>
        </>
    );
}

function AllItems(){
    return (
        <>
        <div className="container-fluid">
            <div className="row mt-3">
                <div className="col-5 m-auto">
                    <div className="card">
                        <ListItems/>
                    </div>
                </div>
            </div>
        </div>
        </>
    );
}

function ListItems(){
    return(
        <>
        <ul className="list-group gap-2">
            <li className="list-group-item fw-bold bg-dark-subtle d-flex align-items-center justify-content-between">
                laptop
                <div className="btn">‚ùå</div>
            </li>
        </ul>
        </>
    );
}
